import React, { Component } from 'react'
import Library from './library/Library';
import Landing from './Landing';
import Popular from './popular/Popular';

class Home extends Component {
    render() {
        return (
            <>
                <Landing />
                <Popular />
                <Library />
            </>
        )
    }
}

export default Home;
